import React from 'react';
import Head from 'next/head';

import styled from 'styled-components';


import '../css/normalize.css';
import '../css/skeleton.css';


class Navbart extends React.Component {

	refA = React.createRef()
  	refB = React.createRef()

	render () {
	    return(
		    <div className="nav">
		      <ul>
		        <li className="home"><a href="#" onClick={() => { this.handleScrollTo(this.refA) }}>Artists</a></li>
		        <li className="tutorials"><a href="#">News</a></li>
		        <li className="about"><a href="#">Label Info</a></li>
		        <li className="news"><a href="#">Store</a></li>
		        <li className="contact"><a href="#">Contact</a></li>
		      </ul>
		    </div>
	    )
	}


	componentDidMount() {
    	this.setState({ loaded: true })
  	}

  	handleScrollTo = (elRef) => {
    // Incase the ref supplied isn't ref.current
    	const el = elRef.current ? elRef.current : elRef

    // Scroll the element into view
    	el.scrollIntoView({
    	behavior: 'smooth',
    	block: 'start'
    	})
  	}

}

export default Navbar;
